      action: isLoggedIn ? "Logged in successfully" : "Login attempt failed",
      extractedData: { loggedIn: isLoggedIn },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
